query GetAllTicksEthereum($poolAddress: String!, $skip: Int!) {
  Ethereum_ticks(
    where: {pool: $poolAddress, liquidityNet_not: 0}
    skip: $skip
    first: 1000
    orderBy: index
    orderDirection: asc
  ) {
    index
    liquidityGross
    liquidityNet
  }
}

